import './header.css';

const Header = () => {
    return (
        <div className="ccs__header section__header section__padding" id="home">
            <div className="css__header-container">
                <h1 className="gradient__text"> ooga booga</h1>
            </div>
            
        </div>
    )
}
export default Header
